import React, { Component } from "react";
import Navbarr from "../Navbar/Navbar";
import { Button, Table, Container } from "react-bootstrap";
import Serverservice from "../../Services/Serverservice";
export default class Yourtickets extends Component {
  componentDidMount() {
    const data = {
      id: localStorage.getItem("id"),
    };
    Serverservice.yourtickets(data)
      .then((response) => {
        console.log(response);
      })
      .catch((err) => {
        console.log(err.response);
      });
  }
  render() {
    return (
      <div>
        <Navbarr />
        <h1 className="text-center">Your Tickets</h1>
        <Container>
          <div className="event mb-3">
            <div style={{ margin: "20px 50px" }}>
              <h3>Abhay</h3>

              <p className="text-muted">
                Gerne <span style={{ float: "right" }}>{this.props.email}</span>{" "}
              </p>

              <p>abhay</p>

              <Table striped bordered hover>
                <thead>
                  <tr>
                    <th>Event Type</th>
                    <th>Event Region</th>
                    <th>Event City</th>
                    <th>Event Date</th>
                    <th>Expected Auidence </th>
                    <th>Ticket Price </th>
                  </tr>
                </thead>
                <tbody>
                  <tr>
                    <td>abhay</td>
                    <td>aa</td>
                    <td>aa</td>
                    <td>aa</td>
                    <td>aa</td>
                    <td>aa</td>
                  </tr>
                </tbody>
              </Table>
              <Button variant="danger">Delete</Button>
            </div>
          </div>
        </Container>
      </div>
    );
  }
}
